import {
  Card,
  CardContent,
  CardMedia,
  Container,
  Grid,
  Typography,
} from "@mui/material";

const immagini = [
  {
    src: "/client-app/public/img/vol1.jpg",
    titolo: "Distrubuzione a Sesto San Giovanni",
  },
  { src: "/client-app/public/img/vol2.jpg", titolo: "Distrubuzione a Seriate" },
  { src: "/client-app/public/img/vol3.jpg", titolo: "Distrubuzione a Milano" },
  {
    src: "/client-app/public/img/vol4.jpg",
    titolo: "Distrubuzione a San Giuliano Milanese",
  },
  {
    src: "/client-app/public/img/vol5.jpg",
    titolo: "Distrubuzione Monza",
  },
  { src: "/client-app/public/img/vol6.jpg", titolo: "Mappa della zona" },
];

export default function Galleria() {
  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Galleria fotografica
      </Typography>

      <Grid container spacing={3}>
        {immagini.map((img, i) => (
          <Grid item xs={12} sm={6} md={4} key={i} {...({} as any)}>
            <Card>
              <CardMedia
                component="img"
                height="200"
                image={img.src}
                alt={img.titolo}
              />
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}
